import React, { Component } from "react";
import './'
export default class Cart extends Component {
	render() {
		return (
			<div>
				{this.props.data.map((item) => (
					<div key={item.id}>
						<div>
							{item.name}
							<img src={item.image} alt={item.name} />
						</div>
						<div>
							<p>{item.rating}</p>
							<p>{item.type}</p>
						</div>
					</div>
				))}
			</div>
		);
	}
}
